import React, { Component } from "react";

class Names extends Component {
  constructor(props) {
    super(props);
    this.state = {
      groups: [
        {
          name,
        },
      ],
    };
  }
  render() {
    return (
      <div>
        <h1>name</h1>
      </div>
    );
  }
}

export default Names;
